import React, { Component } from 'react';
export default class Porfolio extends Component {




  render() {

    return (
      <section id="portfolio">
        <h1>A few of my websites.</h1>
        <div className="row portfolio">
          <div className="three columns header-col">
            <div class="card">
              <a href="http://www.purplepants.io/Project1/" target="_blank">
              <img id="portfolio-images" src="https://studybreaks.com/wp-content/uploads/2018/10/rockconcert1.jpg" class="card-img-top" alt="..."></img>
              </a>
              <div class="card-body">
                            <h5 class="card-title">EventSearch</h5>
                            <p class="card-text">Search for events of all kinds using Google Maps and Ticket Master
                                APIs!</p>
                        </div>
            </div>
          </div>
        </div>


      </section>
    );
  }
}
